(*:Package Version: 3.32 *)

(*:Name: MathWorld`MachinFormulas` *)

(*:Author: Eric Weisstein *)

(*:URL:
  http://mathworld.wolfram.com/packages/MachinFormulas.m
*)

(*:Summary:
  This package is a database of Machin-Like formulas, which are formulas of the form
  
  r Pi = Sum[a[i] ArcCot[b[i]],{i,1,n}]
  
  where r is a rational number (most commonly ArcTan[1]=1/4) and a[i] and b[i]
  are each a set of n integers.  In the tables, formulas are stored as lists in the form
  
    {r,{a[1],b[1]},...{a[n],b[n]}}
  
  Some simple command for manipulating and checking the validity of formulas are also
  included
  
*)

(*:References:

AJ  Arndt, J.  ``Big arctan bucket.''
AJ  Arndt, J.  ``Formulas of the Form k Pi/4 = Sum[m[i] ArcTan[1/x[i]],{i,1,N}].''
      http://www.tu-chemnitz.de/~arndt/jjf.dvi.
    Castellanos 1988
HCL Chien-Lih Hwang (pers. comm. from Hwang Chien-Lih)
    Hwang has been extremely helpful in providing up-to-date versions of his
    list.
MRW Wetherfield, Michael Roby (pers. comm. from Hwang Chien-Lih)
RW  Williams, Roy.  ``Arctangent Formulas for Pi.''
    http://www.ccsf.caltech.edu/~roy/pi.formulas.html.
    I e-mailed Roy multiple times telling him he had many 
    erroneous formulas, but he never bothered getting back to me.
    Thanks to Joe Keene for pointing out to me that the erroneous 
    formulas consisted only of an incorrect first coefficient
    duplicating the last denominator.
*)

