BeginPackage["MathWorld`MachinFormulas`"]


CotFormula::usage =
"Gives the Machin-Like formula from a list of the form  {r,{a[1],b[1]},...{a[n],b[n]}}."

Efficiency::usage =
"Efficiency[a1 Cot[b1]+...] gives Lehmer's efficiency for the Machin-like formula."

HwangParse::usage =
"HwangParse[filename] check's Hwang's list for new entries and prints them."

MachinCheck::usage =
"MachinCheck[i] checks the validity of all Machin-like formulas with i terms.
MachinCheck[{i,j}] checks the validity of all Machin-like formulas with i through j terms.
MachinCheck[] checks the validity of all Machin-like formulas.  MachinCheck returns True
if the formula equals Pi, otheRWise it returns the value of the formula."

MachinList::usage =
"MachinList[n] gives a list of the coefficients of Machin-like formulas of n terms."

MachinNumber::usage =
"MachinNumber[n] gives the number of Machin-like formulas of n terms."

MachinDuplications::usage =
"MachinDuplications gives the number of duplications in the Machin-like formulas."

MachinFormula::usage =
"MachinFormula[n,i] gives the ith Machin-like formula of n terms."

MachinTeXTable::usage =
"MachinTeXTable gives a combined TeX/LaTeX table giving the number of formulas for each number
of terms."


Begin["`Private`"]

Efficiency[m_]:=Module[{i,n=Expand[m]},
  Sum[1/Log[10.,n[[i,2,1]]],{i,Length[n]}]
]

max=21;

MachinNumber[n_]:=0 /; (n<1 || n>max)

MachinNumber[n_]:=Length[MachinList[n]]

HwangParse[instr_String]:=Module[
  {line,i,ret,space,Verbose=False,hwang,l,infile=OpenRead[instr]},
  SetOptions[$Output,PageWidth->Infinity];
  (* Read and print header *)
  Do[Print[Read[infile,String]],{i,37}];
  While[True,
    line=Read[infile,Record,RecordSeparators->{"\n\n"}];
    If[StringPosition[line,"(N+2)[2]-N[3]-(N+1)[7]"]!={},Break[]];
    If[Verbose,Print[line]];
    line=Read[StringToStream[line],Record,RecordSeparators->{"\nELIMINATED","\nEliminated"}];
    If[Verbose,Print[line]];
    space=Min[Flatten[StringPosition[line,{" ","\t"}]]];
    ret=Min[Select[Flatten[StringPosition[line,"\n"]],# > space &]];
    If[ret==Infinity,ret=StringLength[line]];
    line=StringDrop[line,{space,ret}];
    If[Verbose,Print[line]];
    line=StringReplace[line,{"["->",","]"->"},{","+"->"","\t"->""}];
    line=StringReplace[line,{" "->"","{-,"->"{-1,","{,"->"{1,","\n"->""}];
    If[StringTake[line,1]==",",line="1"<>line];
    line=StringDrop[line,-2]<>"}";
    If[Verbose,Print[line]];
    If[StringPosition[line,"="]!={},
      line="{"<>StringReplace[line,",1},{="->"/4, {"],
      line="{1/4, {"<>line
    ];
    hwang=Simplify[ToExpression[line]];
    l=Length[hwang]-1;
    If[!MemberQ[MachinList[l],hwang],
      Print[l,line,","];
    ];
  ];
  Close[infile];
]

MachinDuplications:=
  Print["Duplications: ",Table[Length[MachinList[n]]-Length[Union[MachinList[n]]],{n,max}]];

MachinCheck[{n1_,n2_}]:=Module[{i,n,pi},
  Do[
    pi=MachinFormula[n,i];
    Print["{",n,", ",i,"/",MachinNumber[n],"}: ",
      If[Length[MachinList[n][[i]]]!=n+1,
        "Incorrect length: "<>ToString[Take[MachinList[n][[i]],3]],
        If[Abs[N[pi-Pi,10]]>10^(-9.),
          ToString[N[pi/Pi,10]]<>" "<>ToString[Take[MachinList[n][[i]],3]],
          True
        ]
      ]
    ],
    {n,n1,n2},{i,1,MachinNumber[n]}
  ]
]

MachinCheck[]:=MachinCheck[{1,max}]

MachinCheck[n_]:=MachinCheck[{n,n}]

CotFormula[l_List]:=1/l[[1]]Sum[l[[k,1]] ArcCot[l[[k,2]]],{k,2,Length[l]}]

MachinFormula[n_,i_]:=Module[{k},
  1/MachinList[n][[i,1]] Sum[MachinList[n][[i,k,1]] ArcCot[MachinList[n][[i,k,2]]],
    {k,2,n+1}]
] /; i<=MachinNumber[n]

MachinTeXTable:=Module[{i,n,e={},ef,m},
Print["\\etablee{"];
Print["\\strut\\hfil\\ # & \\hfil # & \\ #\\hfil\\cr"];
Print["\\noalign{\\hrule}"];
Print["$n$ & $N(n)$ & $\\min e$\\cr"];
Print["\\noalign{\\hrule}"];
Print["\\noalign{\\vskip2pt}"];
Print["\\noalign{\\hrule}"];
Do[
  ef=Min[Table[Efficiency[MachinFormula[i,n]],{n,MachinNumber[i]}]];
  e=Append[e,If[ef==Infinity,0,ef]];
  m=MachinNumber[i];
  (* Add Hwang's 3-term 6.60113 *)
  Print[i," & ",m+If[i==3,1,0]," & ",e[[i]],"\\cr"],
  {i,1,max}
];
Print["\\noalign{\\hrule}"];
Print["Total & ",Sum[MachinNumber[i],{i,max}]+1," & ",Min[Select[e,# > 0 &]],"\\cr"];
Print["\\noalign{\\hrule}"]; 
Print["}{"];
Print["\\begin{tabular}{rrl}\\hline"];
Print["$n$ & $N(n)$ & $\\min e$\\\\ \\hline"];
Do[Print[i," & ",MachinNumber[i]+If[i==3,1,0]," & ",e[[i]],"\\\\"],{i,1,max-1}];
Print[max," & ",MachinNumber[max]," & ",e[[max]],"\\\\ \\hline"];
Print["Total & ",Sum[MachinNumber[i],{i,max}]+1," & ",Min[Select[e,# > 0 &]],"\\\\ \\hline"];
Print["\\end{tabular}"];
Print["}\\par"];
]

